import './App.css';
const numbers = Array.from(Array(20).keys());

const FizzBuzz = (num) =>  {	
num.map((x) => {
	let number = x+1;
	return console.log(
	(number % 3 === 0 && number % 5 === 0) ?
		"fizzBuzz" : (number % 5 === 0 ?
				"buzz" : (number % 3 === 0 ?
					"fizz" : number)
					)
				);
})
};


function App() {
	FizzBuzz(numbers);
 return (
    <div className="App">
<ul className="fizzBuzz">

</ul>
    </div>
  );
}

export default App;
